class CallbackRegistry{constructor(){this.registry={}}addCallback(t,r){this.registry[t]=r}getCallback(t){return this.registry[t]}toJSON(){const e={};return Object.keys(this.registry).forEach(t=>{const{func:r,type:s}=this.getCallback(t);e[t]={func:r.toString(),type:s}}),e}}export default CallbackRegistry;